         pvalue->secHdr.protoDiscr = TS24007L3_ProtoDiscr_epsMobMgmt;
         pvalue->secHdr.msgAuthCode = 0;
         pvalue->secHdr.seqNumber  = 0;
         pvalue->protoDiscr = TS24007L3_ProtoDiscr_epsMobMgmt;
         pvalue->msgType = 0;
   
